void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy;

    float x = uv.x;
    float y = uv.y;

    float p = 1.3;

    float t = 100.0 * sin(iTime / 60.0);

    float l = (p * (t + x))/(y + cos(pow(t + x, exp(p)))) - p;

    fragColor = vec4(l / t, 0.0, 0.5 + 0.5 * sin(iTime + x + y), 1.0);
}
